import React, { useState } from "react";
import Home from "./Home";
import Chat from "./Chat";

function App() {
  const [nickname, setNickname] = useState("");

  return nickname ? (
    <Chat nickname={nickname} />
  ) : (
    <Home onStart={setNickname} />
  );
}

export default App;
